function NotificationCenter(){
    return(
        <div className="fixed w-screen h-screen inset-0 bg-gray-400 bg-opacity-80">
            <div className="absolute transform w-3/5 h-3/5 top-1/2 left-1/2 -translate-y-1/2 -translate-x-1/2 bg-white rounded-md">
               <div id='notificationCenterNavBar' className="float-right">
                    <img src='/icos/x.svg' className="symbol p-1 m-1 float-right"/>
               </div>
            </div>
        </div>
    )
}
export default NotificationCenter
